import React from 'react';
import { Link } from 'react-router-dom';
const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to='/'>Home</Link>
        </li>
        <li>
          <Link to='/updated'>Updated Employees</Link>
        </li>
        <li>
          <Link to='/deleted'>Deleted Employees</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
